import java.util.HashSet;

public class HashSetting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
 
	
		HashSet<String> h = new HashSet<String>();
		h.add("lemur");
		h.add("orangatang");
		h.add("spider monkey");
		
		System.out.println(h.contains("gorilla"));
	
	
	}

}
